import React, { Component } from "react";
import {
  CarouselProvider,
  Slider,
  Slide,
  ButtonBack,
  ButtonNext,
} from "pure-react-carousel";
import classNames from "classnames";

import "pure-react-carousel/dist/react-carousel.es.css";
// import { SectionProps } from '../../utils/SectionProps';

